INSERT INTO `wp_posts` VALUES (2,1,'2018-02-21 04:15:11','2018-02-21 04:15:11','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://staff.loc/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2018-03-01 05:29:12','2018-03-01 05:29:12','',0,'http://staff.loc/?page_id=2',0,'page','',0),(16,1,'2018-02-21 04:23:23','2018-02-21 04:23:23','Welcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.','Home','','publish','closed','closed','','home','','','2018-02-21 04:23:23','2018-02-21 04:23:23','',0,'http://staff.loc/?page_id=16',0,'page','',0),(17,1,'2018-02-21 04:23:23','2018-02-21 04:23:23','You might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.','About','','trash','closed','closed','','about__trashed','','','2018-03-01 22:19:23','2018-03-01 22:19:23','',0,'http://staff.loc/?page_id=17',0,'page','',0),(18,1,'2018-02-21 04:23:23','2018-02-21 04:23:23','This is a page with some basic contact information, s